@JacobAndco breaking the traditional watchmaking rules with its incredible “Oil Pump” wristmachine that blends together art, modern tech, and old-school watchmaking.
This machine features a double axis tourbillon inside a white gold and Sapphire Case with a Derrick which can be activated/animated on demand with a pusher at 2 o’clock. 🔥
Released in a very Limited Ed, only 88 pieces worldwide priced $380,000.00
